import{useEffect,useState}from"react";import{useParams}from"react-router-dom";import Axios from"axios";export default function Questions(){const[examDataExport,setExamData]=useState({id:"",moduleId:"",examContent:""}),{id:id}=useParams();return useEffect(()=>{const fetchUserData=async()=>{try{const response=await Axios.get(`http://localhost:8000/fetchQuiz/${id}`),examData=response.data;if(examData.length>0){const dataExam=examData[0];setExamData({id:dataExam.id,moduleId:dataExam.moduleId,examContent:dataExam.examContent})}}catch(error){console.error("Error fetching user data:",error)}};id&&fetchUserData()},[id]),examDataExport}